import React, {Component} from 'react';

class Footer extends Component{

    render() {
        return (
            <footer className="page-footer font-small blue">
                <div className="text-center py-3">
                    Coded by JiehaoLuo
                </div>
            </footer>
        )
    }
}

export default Footer;
